import React from "react";

const Login = () => {
  const handleGoogleLogin = () => {
    window.location.href = "http://localhost:4000/api/auth/google";
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: 100 }}>
      <label style={{ marginBottom: '8px' }}> Username </label>
      <input type="text" placeholder="Nhập username.." ></input>
      <label style={{ marginBottom: '8px' }}> Password </label>
      <input type="password" placeholder="Nhập password.." ></input>
      <button onClick={handleGoogleLogin} style={{ padding: '10px 20px', fontSize: '16px', margin: '16px 0' }}>
        Đăng nhập với Google
      </button>
    </div>
  );
};

export default Login;
